import React from "react";
import { useGlobalContext } from "../context";

export default function Meal(){
    const { meals } = useGlobalContext()
    console.log(meals.meals)
   
    return (
        <section> 
            { meals.map((me)=>{
            return (
                <h1>{me.strMeal}</h1>
            )
        })}
       </section> 

    )
}
